import React from 'react';
import './css/style.css';
import FirstRow from './FirstRow';
import SecondRow from './SecondRow';
import ThirdRow from './ThirdRow';

const Footer = () => {
    return (
        <footer className="footer container-fluid">
            <FirstRow />
            <SecondRow />
            <ThirdRow />
        </footer>
    );
} 

export default Footer;
